const About = () => {
  return (
    <div id="introID" className="intro">
        <h1>Welcome</h1>
        <p>Hi there! 
            My name is Tara. 
            Welcome to my page!</p>
        <h2>Background</h2>
        <p>I'm an industrial engineer who enjoy programming and learning new things!</p>
    </div>
  )
}
export default About;
